import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "../../css/PatientDashboard.css";
import PatientNavbar from "./PatientNavbar";
import api from "../../api"
export default function PatientDashboard() {
  const navigate = useNavigate();
  const [profile, setProfile] = useState({});
  const [appointments, setAppointments] = useState([]);
  const [prescriptions, setPrescriptions] = useState([]);
  const [loading, setLoading] = useState(true); // 👈 loader state

  const getInitials = (firstName, lastName) => {
    if (!firstName && !lastName) return "??";
    return `${firstName?.[0] || ""}${lastName?.[0] || ""}`.toUpperCase();
  };

  useEffect(() => {
    setLoading(true);
    api.get("http://localhost:8080/patient/profile", { withCredentials: true })
      .then(res => {
        setProfile(res.data);
        return api.get(`http://localhost:8080/patient/appointments`, { withCredentials: true });
      })
      .then(res => {
        setAppointments(res.data);
        // Example static prescriptions
        setPrescriptions([
          { date: "2025-03-20", file: "prescription1.pdf" },
          { date: "2025-03-30", file: "prescription2.pdf" },
        ]);
      })
      .catch(err => {
        console.error("Error fetching dashboard data:", err);
      })
      .finally(() => {
        setLoading(false);
      });
  }, []);

  console.log(profile);
  console.log(appointments);

  return (
    <div>
      <PatientNavbar fie />
      <div className="dashboard-wrapper">
        {loading ? (
          <div className="loader-container">
            <div className="spinner"></div>
            <p>Loading dashboard...</p>
          </div>
        ) : (
          <>
            <div className="profile-header">
              <div className="profile-circle">{getInitials(profile.firstName, profile.lastName)}</div>
              <div>
                <h2 className="dashboard-title">Welcome, {profile.firstName} {profile.lastName} 👋</h2>
              </div>
            </div>

            <div className="dashboard-grid">
              <div className="card">
                <h3>📁 Health Summary</h3>
                <p>You have {prescriptions.length} recent prescriptions.</p>
              </div>

              <div className="card">
                <h3>📅 Upcoming Appointments</h3>
                <ul>
                  {appointments.map((apt, i) => (
                    <li key={i}>
                      <strong>{apt.date}</strong> - {apt.doctorName} ({apt.department})
                    </li>
                  ))}
                </ul>
              </div>

              <div className="card">
                <h3>📝 Book Appointment</h3>
                <p>Choose your department, preferred date and time, and the doctor.</p>
                <button className="btn-primary" onClick={() => navigate("/book-appointment")}>Book Now</button>
              </div>

              <div className="card clickable-card" onClick={() => navigate("/records")}>
                <h3>📂 View Medical Records</h3>
                <p>Access all your prescriptions, test reports, and previous visits.</p>
                <button className="btn-outline">View Records</button>
              </div>
            </div>
          </>
        )}
      </div>
    </div>
  );
}
